import React from 'react';
import {View, Text, TouchableOpacity, StyleSheet} from "react-native";

export default function Home({navigation}){
return (
    <View style={styles.container}>
        <Text style={styles.text}>Bem Vindo!</Text>
        <View style={styles.areaBtn}>
          <TouchableOpacity
            style={[styles.botao, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Cadastrar Pet')}
          >
            <Text style={styles.botaoText}>Gerenciar Pets</Text>
          </TouchableOpacity>
        </View>

        <View style={styles.areaBtn}>
          <TouchableOpacity
            style={[styles.botao, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Cadastrar Pet')}
          >
            <Text style={styles.botaoText}>Gerenciar Protetores</Text>
          </TouchableOpacity>
        </View>

        <View style={styles.areaBtn}>
          <TouchableOpacity
            style={[styles.botao, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Cadastrar Pet')}
          >
            <Text style={styles.botaoText}>Gerenciar Doações</Text>
          </TouchableOpacity>
        </View>

    </View>
)
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
    },
    text:{
      backgroundColor: "#4F7063",
      height: 100,
      marginTop: 25,
      marginBottom: 15,
      fontSize: 25,
      fontWeight: "bold",
    },
    areaBtn: {
      alignItems: "center",
      flexDirection: "row",
      marginTop: 30,
      justifyContent: "space-around",
    },
    botao: {
      height: 127,
      justifyContent: "center",
      alignItems: "center",
      padding: 15,
      borderRadius: 30,
      width:'80%',
    },
    botaoText: {
      fontSize: 22,
      color: "#FFF",
    },
  });
